package main

import "fmt"

func numSubarrayProductLessThanK(nums []int, k int) int {
	if k <= 0 {
		return 0
	}
	total := 0
	L := 0
	R := 0
	t := 1
	for L = 0; L < len(nums); L++ {
		for ; R < len(nums); R++ {
			t *= nums[R]
			if t >= k {
				break
			}
		}
		total += R - L
		if R == len(nums) {
			total += (R - L) * (R - L - 1) / 2
			return total
		}
		if nums[R] >= k {
			total += (R - L) * (R - L - 1) / 2
			R += 1
			L = R - 1
			t = 1
			continue
		}
		t = t / nums[L] / nums[R]
	}
	return total
}

